import { createRouter, createWebHistory } from 'vue-router';
import LayoutView from '../views/LayoutVieW.vue'; // 레이아웃 컴포넌트
import CategoryView from '../views/CategoryView.vue'; // 카테고리 페이지
import CommunityView from '../views/CommunityView.vue'; // 커뮤니티 페이지
import GuidelinesView from '../views/GuidelinesView.vue'; // 이용안내 페이지
import MyBooksView from '../views/MyBooksView.vue'; // 나만의책장 페이지

const routes = [
  {
    path: '/',
    name: 'Home',
    component: LayoutView, // 레이아웃 컴포넌트 사용
    children: [
      {
        path: 'category',
        name: 'Category',
        component: CategoryView,
      },
      {
        path: 'community',
        name: 'Community',
        component: CommunityView,
      },
      {
        path: 'guidelines',
        name: 'Guidelines',
        component: GuidelinesView,
      },
      {
        path: 'mybooks',
        name: 'MyBooks',
        component: MyBooksView,
      },
    ],
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
